characterList = []
characterSize = 9

currentWord = ''
currentGuessedWords = []
currentScore = 0


levelTimer = [-1, 120, 100, 80, 60]
targetScore = 100
currentLevel = 1
currentTimer = levelTimer[currentLevel]
maxLevel = levelTimer.length - 1;


currentActiveInterval = undefined


window.onload = function () {
    main();
};

function contains(arr, element){
    for(var i = 0; i < arr.length; i++){
        if(arr[i] == element) return true;
    }
    return false;
}

function getRandom(end){
    return (Math.random() * end) | 0;
}

function getScore(num){
    return (num * (num+1))/2;
}

function addScore(word){
    len = word.length;
    score = getScore(len);
    currentScore += score;
    console.log(score);
    console.log(currentScore);
    updateScoreInHtml();
}

function populateKeyboardItem(pos, val){
    document.getElementById('alphabet-'+pos).innerText = val;
}

function updateCurrentWordInHtml(){
    document.getElementById('guess-word').innerText = currentWord;
}

function updateScoreInHtml(){
    document.getElementById('total-score-value').innerText = currentScore;
}

function updateGuessWordScoreInHtml(score){
    document.getElementById('guess-score').innerText = score;
}

function updateTimerInHtml(){
    document.getElementById('timer-value').innerText = currentTimer;
}

function updateProgressBarInHtml(){
    perc = (currentTimer*100)/levelTimer[currentLevel] 
    document.getElementById('timer-progress').style.width = perc+"%";
}

function showNextLevelButtonInHtml(){
    document.getElementById('next-level-button').classList.remove('hide');
}

function hideNextLevelButtonInHtml(){
    document.getElementById('next-level-button').classList.add('hide');
}

function updateCurrentLevelInHtml(){
    document.getElementById('level-value').innerHTML = currentLevel;
}

function updateTargetScoreInHtml(){
    document.getElementById('target-score').innerHTML = targetScore;
}

function updateGuessWord(){
    score = getScore(currentWord.length);
    updateGuessWordScoreInHtml(score);
}

function selectRandomLayoutAndPopulate(){
    keyboardPos = getRandom(keyboardAlphabetDict.length)
    console.log(keyboardAlphabetDict[keyboardPos][0])
    populateKeyboardLayout(keyboardAlphabetDict[keyboardPos][0])
}

function populateKeyboardLayout(arr){
    characterList = [...arr]

    for(var i=0;i<characterSize;i++){
        populateKeyboardItem(i, characterList[i])
    }
}

function clearGuessWordAndGuessScore(){
    currentWord = '';

    updateCurrentWordInHtml()
    updateGuessWord()
}

function updateTimer(){
    if(currentTimer == 0) return;
    
    currentTimer -= 1;
    updateTimerInHtml();
    updateProgressBarInHtml();
}

function initializeTimer(){
    if(currentActiveInterval != undefined){
        clearInterval(currentActiveInterval);
    }
    currentActiveInterval = setInterval(updateTimer, 1000);
}

function populateLevelRelatedValues(){
    hideNextLevelButtonInHtml();
    updateCurrentLevelInHtml();
    updateTargetScoreInHtml();
    currentTimer = levelTimer[currentLevel];
}

function main() {
    console.log("main method");

    populateLevelRelatedValues();
    selectRandomLayoutAndPopulate();
    initializeTimer();
    clearLevelSpecificVariables();
}

function clearLevelSpecificVariables(){
    currentScore = 0;
    updateScoreInHtml();
}

function pressCharacter(index) {
    if(currentTimer == 0) return;

    console.log(`pressed character at index ${index}`);
    currentWord += characterList[index]
    console.log(currentWord)

    updateCurrentWordInHtml()
    updateGuessWord()
    
    animateButtonPress('alphabet-'+index);
}

function enterBack() {
    if(currentTimer == 0) return;


    if(currentWord.length == 0) return;
    currentWord = currentWord.slice(0, -1)
    console.log(currentWord)

    updateCurrentWordInHtml()
    updateGuessWord()

    animateButtonPress('back-button');
}

function enterSubmit() {
    if(currentTimer == 0) return;

    console.log(currentGuessedWords)
    if(contains(currentGuessedWords, currentWord)){
        console.log("you already guessed this word : "+currentWord);
    }
    else{
        if(contains(wordDictionary, currentWord)){
            console.log("good u guessed right : " + currentWord);
            currentGuessedWords.push(currentWord);
            addScore(currentWord);

            selectRandomLayoutAndPopulate();
            clearGuessWordAndGuessScore();

            showNextLevelButtonIfValid();
        }
        else{
            console.log("u r word is incorrect : "+ currentWord);
        }
    }
    animateButtonPress('enter-button');
}


function showNextLevelButtonIfValid(){
    if(currentScore >= targetScore){
        if(currentLevel < maxLevel){
            showNextLevelButtonInHtml()
        }
    }
}


function moveToNextLevel(){
    if(currentLevel < maxLevel){
        currentLevel += 1;
    }

    main();
}

function isCorrectWord(word) {
    isContains = wordDictionary.contains(word);
    return isContains;
}

function printCountWords() {
    console.log(wordDictionary.length)
}


function animateButtonPress(elementId){
    element = document.getElementById(elementId)
    element.style.animation = 'pulse'
    element.style['animation-duration'] = '0.5s'
    
    element.onanimationend = () => {
        document.getElementById(elementId).style.animation = '';
    };
}
